import React from 'react';
import { Link } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';
import styles from './Nav.module.css'


function Nav() {

  return (
    <div className={`${styles.nav} nav`}> 
      <Header color='black'></Header>
      <ul className={styles.gnbList}>
        <li>
          {/* <a href="/Default/Profile"></a> */}
          <Link to='/twice/profile'>PROFILE</Link>
        </li>
        <li>
          <a href="/Default/DiscographyList">DISCOGRAPHY</a>
        </li>
        <li>
          <a href="/Default/Gallery">GALLERY</a>
        </li>
        <li>
          <a href="/Default/Video">VIDEO</a>
        </li>
        <li>
          <a href="/Default/NoticeList">NOTICE</a>
        </li>
        <li>
          <a href="/Default/Schedule">SCHEDULE</a>
        </li>
      </ul>
      <Footer color='black'></Footer>
    </div>
  );
}

export default Nav;
